import React from "react";
import { createRoot } from "react-dom";
import "./App.css";

// const myList = ["apple", "orange", "banana"];

const root = document.getElementById("root");
const divReact = React.createElement(
  "div",
  {
    className: "container",
    title: "hello",
  },
  React.createElement(
    "h2",
    {
      className: "title",
    },
    "Tiêu đề đầu"
  ),
  React.createElement(
    "div",
    {
      className: "wrapper",
    },
    React.createElement(
      "ul",
      null,
      React.createElement("li", null, "js"),
      React.createElement("li", null, 'reactjs')
    )
  )
);

function inputText () {
  <label htmlFor="EMAIL">Email</label>
}

const rootContainer = createRoot(root);
rootContainer.render(divReact);

function App() {
  return (
    <div className="App">
      <div id="root"></div>
      {/* {myList.map((item , index) => (
        <p key={index}>{item}</p>
      ))} */}
    </div>
  );
}

export default App;
